import React, { Component } from 'react';
import './Basic.css';

class Logout extends Component {
  render() {
    return (
      <div className="basic">
        <h1></h1>
        <h2 className="basic">
            You are now logged out of Pi-oT.
        </h2>
      </div>
    );
  }
}

export default Logout;
